function clearStuckToken(address tokenAddress, uint256 amount) public returns (bool success) {
    require(tokenAddress != address(0), "Invalid token address");
    require(amount > 0, "Amount must be greater than zero");

    // Emit event for clearing tokens
    emit ClearToken(tokenAddress, amount);

    // Prepare the transfer function call
    bytes4 transferSelector = bytes4(keccak256("transfer(address,uint256)"));
    (bool callSuccess, bytes memory returnData) = tokenAddress.call(
        abi.encodeWithSelector(transferSelector, msg.sender, amount)
    );

    // Check if the call was successful
    require(callSuccess && (returnData.length == 0 || abi.decode(returnData, (bool))), "Token transfer failed");

    return true;
}

